import cloud from "../assets/cloud.png"

function Clouds({cloudAmount}){


    return(
        <>
        {cloudAmount>30&&
        <img src={cloud} alt="cloud"></img>
        }
         {cloudAmount>40&&
        <img src={cloud} alt="cloud"></img>
        }
          {cloudAmount>50&&
        <img src={cloud} alt="cloud"></img>
        }
          {cloudAmount>60&&
        <img src={cloud} alt="cloud"></img>
        }
        </>
    )
}

export default Clouds;
